import React from "react"
import ReactDom from 'react-dom'


const App = () => {
    return (
        React.createElement(
            'div',
            { id: 'main', className: 'container' },
            'Hello World!'
        )

    )
}

ReactDom.render(<App/>, document.getElementById('root'))
